import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'

function Table(props) {

  return (
    <div className="">
       {
          props.getData.length>0?
          (
            props.getData.map(e=>              
                <div className="each-task" key={e._id}>  
                     <div>                                  
                      {e.task}
                      </div>
                      <div> 
                      {e.type}
                      </div>
                      <div> 
                      {e.describe}
                      </div>
                      {e.time} 

                  <button id="remove" className="btn btn-info">Edit</button>
                  <button id="remove" className="btn btn-danger">Delete</button>

                </div>          
            )
          ) : 
          (
            <div>no data</div>
          )             
       }     
      </div>
  );
}

export default Table;
